import React from "react";
import Video from "../components/Video";

const ContentPage = () => {
  return (
    <div className="content-container">
      <iframe
        width="560"
        height="315"
        src="https://www.youtube.com/embed/xLD8oWRmlAE"
        frameborder="0"
        allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
        allowfullscreen
      ></iframe>
      <Video src="https://www.youtube.com/watch?v=3P1CnWI62Ik" title="서울" />
      <Video src="https://www.youtube.com/watch?v=dQ_lCmB2hfk" title="전주" />
      <Video src="https://www.youtube.com/watch?v=xLD8oWRmlAE" title="부산" />
    </div>
  );
};

export default ContentPage;
